///////////////////////
// Welcome to Cursor //
///////////////////////

/*
Step 1: Try generating a react component that lets you play tictactoe with Cmd+K or Ctrl+K on a new line.
  - Then integrate it into the code below and run with npm start

Step 2: Try highlighting all the code with your mouse, then hit Cmd+k or Ctrl+K. 
  - Instruct it to change the game in some way (e.g. add inline styles, add a start screen, make it 4x4 instead of 3x3)

Step 3: Hit Cmd+L or Ctrl+L and ask the chat what the code does

Step 4: To try out cursor on your own projects, go to the file menu (top left) and open a folder.
*/


import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import './styles.css';

// Main page component
function MainPage() {
  return (
    <div className="app-container">
      <Header />
      <main className="main-content">
        <div className="title-section">
          <h1 className="main-title">Hi, I'm Citlali</h1>
          <p className="welcome-text">Welcome to my website. Click around and get to know me.</p>
        </div>
        <div className="icon-grid">
          <Link to="/listen" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/listen.gif" alt="Listen" />
            </div>
            <span>LISTEN</span>
          </Link>
          <Link to="/laugh" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/laugh.gif" alt="Laugh" />
            </div>
            <span>LAUGH</span>
          </Link>
          <Link to="/read" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/read.gif" alt="Read" />
            </div>
            <span>READ</span>
          </Link>
          <Link to="/see" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/see.gif" alt="See" />
            </div>
            <span>SEE</span>
          </Link>
          <Link to="/tech" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/tech.gif" alt="Tech" />
            </div>
            <span>TECH</span>
          </Link>
          <Link to="/shop" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/shop.gif" alt="Shop" />
            </div>
            <span>SHOP</span>
          </Link>
          <Link to="/tour" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/tour.gif" alt="Tour" />
            </div>
            <span>TOUR</span>
          </Link>
          <Link to="/surprise" className="icon-item">
            <div className="icon-wrapper">
              <img src="/assets/gifs/surprise.gif" alt="Surprise" />
            </div>
            <span>SURPRISE ME</span>
          </Link>
        </div>
      </main>
      <Footer />
    </div>
  );
}

// Listen Page Component
function ListenPage() {
  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="content-section">
          <h2>Listen to My Music</h2>
          <div className="music-player">
            {/* Add your music player component here */}
            <p>Music content coming soon...</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// Laugh Page Component
function LaughPage() {
  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="content-section">
          <h2>Funny Moments</h2>
          <div className="comedy-content">
            {/* Add your comedy content here */}
            <p>Comedy content coming soon...</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// Read Page Component
function ReadPage() {
  const [expandedSection, setExpandedSection] = React.useState(null);

  const toggleSection = (section) => {
    setExpandedSection(expandedSection === section ? null : section);
  };

  return (
    <div className="app-container">
      <Header />
      <div className="read-container">
        <h2>My Poetry</h2>
        <p className="subtitle">A collection of my thoughts and feelings</p>

        <div className="poetry-section">
          <h3>Screaming and Chatter Collection</h3>
          <div className="poem-item">
            <div className="poem-header" onClick={() => toggleSection('screaming')}>
              <h4>Screaming and Chatter</h4>
              <span className="expand-icon">{expandedSection === 'screaming' ? '−' : '+'}</span>
            </div>
            {expandedSection === 'screaming' && (
              <div className="poem-content">
                <p>Poetry content coming soon...</p>
              </div>
            )}
          </div>
        </div>

        <div className="poetry-section">
          <h3>Winsome Wetlands</h3>
          <div className="poem-item">
            <div className="poem-header" onClick={() => toggleSection('wetlands')}>
              <h4>Winsome Wetlands</h4>
              <span className="expand-icon">{expandedSection === 'wetlands' ? '−' : '+'}</span>
            </div>
            {expandedSection === 'wetlands' && (
              <div className="poem-content">
                <p>Poetry content coming soon...</p>
              </div>
            )}
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// See Page Component
function SeePage() {
  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="content-section">
          <h2>Visual Art</h2>
          <div className="art-gallery">
            {/* Add your art gallery component here */}
            <p>Art content coming soon...</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// Tech Page Component
function TechPage() {
  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="content-section">
          <h2>Technical Projects</h2>
          <div className="tech-projects">
            {/* Add your tech projects here */}
            <p>Tech content coming soon...</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// Shop Page Component
function ShopPage() {
  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="content-section">
          <h2>Shop</h2>
          <div className="shop-items">
            {/* Add your shop items here */}
            <p>Shop content coming soon...</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// Tour Page Component
function TourPage() {
  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="content-section">
          <h2>Tour Dates</h2>
          <div className="tour-dates">
            {/* Add your tour dates here */}
            <p>Tour content coming soon...</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

// Surprise Page Component
function SurprisePage() {
  const navigate = useNavigate();
  const pages = ['/listen', '/laugh', '/read', '/see', '/tech', '/shop', '/tour'];

  React.useEffect(() => {
    const randomPage = pages[Math.floor(Math.random() * pages.length)];
    const timer = setTimeout(() => {
      navigate(randomPage);
    }, 2000);
    return () => clearTimeout(timer);
  }, [navigate]);

  return (
    <div className="app-container">
      <Header />
      <div className="page-container">
        <div className="loading-text">Taking you somewhere special...</div>
      </div>
      <Footer />
    </div>
  );
}

// Contact Page Component
function ContactPage() {
  const [formData, setFormData] = React.useState({
    name: '',
    email: '',
    message: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // TODO: Implement email sending and Google Sheets integration
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <div className="app-container">
      <Header />
      <div className="contact-container">
        <h2>Get in Touch</h2>
        <form className="contact-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Name</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="message">Message</label>
            <textarea
              id="message"
              name="message"
              value={formData.message}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit" className="submit-button">Send Message</button>
        </form>
      </div>
      <Footer />
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/listen" element={<ListenPage />} />
        <Route path="/laugh" element={<LaughPage />} />
        <Route path="/read" element={<ReadPage />} />
        <Route path="/see" element={<SeePage />} />
        <Route path="/tech" element={<TechPage />} />
        <Route path="/shop" element={<ShopPage />} />
        <Route path="/tour" element={<TourPage />} />
        <Route path="/surprise" element={<SurprisePage />} />
        <Route path="/contact" element={<ContactPage />} />
      </Routes>
    </Router>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
